import React, { useState } from 'react';
import axios from 'axios';
import Header from '../components/header'; 
import Footer from '../components/footer';

const NewOrderForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    items: [{ type: '', kilo: '' }],
    service: 'Washing',
    description: ''
  });

  const handleInputChange = (e, index) => {
    const { name, value } = e.target;
    const newFormData = { ...formData };
    if (name === 'type' || name === 'kilo') {
      newFormData.items[index][name] = value;
    } else {
      newFormData[name] = value;
    }
    setFormData(newFormData);
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const orderData = {
        customer: {
          firstName: formData.firstName,
          lastName: formData.lastName
        },
        items: formData.items,
        service: formData.service,
        description: formData.description
      };

      await axios.post('http://localhost:3000/order/postorder', orderData);
      alert('Order submitted successfully');
    } catch (error) {
      console.error('Error submitting order:', error);
      alert('Error submitting order');
    }
  };

  return (
    <div>
      <Header />
      <div className="container">
        <br />
        <h1 className="mb-4">New Order Form</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="firstName">First Name:</label>
            <input type="text" className="form-control" id="firstName" name="firstName" value={formData.firstName} onChange={e => handleInputChange(e)} />
          </div>

          <div className="form-group">
            <label htmlFor="lastName">Last Name:</label>
            <input type="text" className="form-control" id="lastName" name="lastName" value={formData.lastName} onChange={e => handleInputChange(e)} />
          </div>

          <div>
            {formData.items.map((item, index) => (
              <div key={index}>
                <div className="form-group">
                  <label htmlFor={`type${index}`}>Item Type:</label>
                  <select className="form-control" id={`type${index}`} name="type" value={item.type} onChange={e => handleInputChange(e, index)}>
                    <option value="regular load">Regular Load</option>
                    <option value="heavy load">Heavy Load</option>
                  </select>
                </div>
                <div className="form-group">
                  <label htmlFor={`kilo${index}`}>Kilos:</label>
                  <input type="number" className="form-control" id={`kilo${index}`} name="kilo" value={item.kilo} onChange={e => handleInputChange(e, index)} />
                </div>
              </div>
            ))}
          </div>

          <div className="form-group">
            <label htmlFor="service">Service:</label>
            <select className="form-control" id="service" name="service" value={formData.service} onChange={e => handleInputChange(e)}>
              <option value="Washing">Washing</option>
              <option value="Drying">Drying</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="description">Description:</label>
            <textarea className="form-control" id="description" name="description" value={formData.description} onChange={e => handleInputChange(e)}></textarea>
          </div>

          <button type="submit" className="btn btn-primary">Submit</button>
        </form>
      </div>
      <Footer/>
    </div>
  );
};

export default NewOrderForm;
